        <g ed:note="&lt;body style=&quot; font-family:'SimSun'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>著名范例：&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑'; font-weight:600;&quot;>欧几里得：证明素数有无穷多个。&lt;/span>&lt;/p>&lt;p style=&quot;-qt-paragraph-type:empty; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;  font-family:'微软雅黑'; font-weight:600;&quot;>&lt;br />&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>假设命题不真，则素数为有限个，将其按升序排列，记为 a1 &amp;lt; a2 &amp;lt; ... &amp;lt; an&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>构造一个新的数 N = a1 * a2 * ... * an + 1&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>显然所有素数 ai（i=1，2，...，n）均不是 N 的因数&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>此时有两种可能：&lt;/span>&lt;/p>&lt;ol style=&quot;margin-top: 0px; margin-bottom: 0px; margin-left: 0px; margin-right: 0px; -qt-list-indent: 1;&quot;>&lt;li style=&quot; font-family:'微软雅黑';&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>N 有另外的素数真因子&lt;/li>&lt;li style=&quot; font-family:'微软雅黑';&quot; style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>N 本身就是一个素数&lt;/li>&lt;/ol>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>显然，由于 N 比所有 ai 都大，所以无论是哪种情况，我们都发现了新的素数&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>这就与假设矛盾，根据排中律，命题就是真的&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(288,4)" xlink:href="#imgnote"/>
        </g>
    </g>

            <tspan y="16.1" style="white-space:pre" x="8">命题公式：由命题常元、命题变元和逻辑联结词组成的形式更为复杂的命题</tspan>
        </text>
    </g>
    <g ed:parentid="467" ed:height="23.9833" transform="matrix(1,0,0,1,364.64,1214.4)" ed:layout="rightmap" ed:width="113.2" id="509">
        <path fill="#ffffff" d="M0,0L113.2,0L113.2,24L0,24L0,0z"/>

        <text class="st4">
            <tspan y="16.1" style="white-space:pre" x="8">命题公式的定义</tspan>
        </text>
    </g>
    <g ed:parentid="509" ed:height="23.98333250880241" transform="matrix(1,0,0,1,504.84,1173.52)" ed:layout="rightmap" ed:width="412.8" id="510">
        <path fill="#ffffff" d="M0,0L412.8,0L412.8,24L0,24L0,0z"/>
        <path stroke-linejoin="round" d="M0,24L412.8,24" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st4">
            <tspan y="16.1" style="white-space:pre" x="8">1.命题常元和命题变元是命题公式，特别地，称作原子公式或原子</tspan>
        </text>
    </g>
    <g ed:parentid="509" ed:height="43.98333250880241" transform="matrix(1,0,0,1,504.84,1204)" ed:layout="rightmap" ed:width="528" id="511">
        <path fill="#ffffff" d="M0,0L528,0L528,44L0,44L0,0z"/>
        <path stroke-linejoin="round" d="M0,44L528,44" fill="none" stroke-width="1.33333" stroke="#454545"/>
        <text class="st4">
            <tspan y="16.9" style="white-space:pre" x="8">2.如果A，B是命题公式，那么（¬A）、（A∧B）、（A∨B）、（A→B）、（A↔B）</tspan>
            <tspan y="36.1" style="white-space:pre" x="8">都是命题公式</tspan>
        </text>
    </g>
    <g ed:parentid="509" ed:height="24.78333250880241" transform="matrix(1,0,0,1,504.84,1254.48)" ed:layout="rightmap" ed:width="358.4" id="512">

        <text class="st4">
            <tspan y="16.1" style="white-space:pre" x="8">3.只有</tspan>
            <tspan class="st8" style="white-space:pre" x="45">有限步</tspan>
            <tspan style="white-space:pre" x="84">引用上述两条所组成的符号串才是命题公式</tspan>
        </text>
    </g>
    <g ed:parentid="396" ed:height="29.4" transform="matrix(1,0,0,1,1058.84,1211.69)" ed:layout="rightmap" ed:width="343.928" id="513">
        <path stroke-linejoin="round" fill="#ffffff" d="M14.7,0L329.2,0C337.3,0,343.9,6.6,343.9,14.7C343.9,22.8,337.3,29.4,329.2,29.4L14.7,29.4C6.6,29.4,0,22.8,0,14.7C0,6.6,6.6,0,14.7,0z" stroke-width="2" stroke="#00af54"/>
        <text class="st9">
            <tspan y="19" style="white-space:pre" x="13">可将命题公式称作公式，采用大写 A、B、C 表示</tspan>
        </text>
        <g ed:note="&lt;body style=&quot; font-family:'SimSun'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>大写的 A、B、C 表示公式&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>小写的 p、q、r、s 表示命题&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(314,7)" xlink:href="#imgnote"/>
        </g>
    </g>

    </g>

        </text>
        <g ed:note="&lt;body style=&quot; font-family:'SimSun'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>¬pvq等同于((¬p)vq)&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:0px; margin-bottom:0px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px; &quot;>&lt;span style=&quot; font-family:'微软雅黑';&quot;>p→q∧r→s并不是((p→q)∧(r→s))，其实是((p→(q∧r))→s)&lt;/span>&lt;/p>&lt;/body>">
            <use transform="translate(381,4)" xlink:href="#imgnote"/>
        </g>
    </g>
